import MotApp from "./MotApp";

const express = require("express");

const app = express();

app.get("/", (req, res) => {
  res.send("Welcome to CORS server ðŸ˜");
});
app.get("/cors", (req, res) => {
  res.send("This has CORS enabled ðŸŽˆ");
});
app.listen(8080, () => {
  console.log("listening on port 8080");
});

function App() {
  return <MotApp />;
}

export default App;
